import React from 'react';
import {HashRouter,Route} from "react-router-dom";
import App from "./App";
import Search from "./Search"

const Router=()=>{
    return( 
        <HashRouter>

            <Route path="/" component={App}/>
            <Route path="/search" component={Search}/>

        </HashRouter>
    );
}

export default Router;
